
-- Departments table
CREATE TABLE IF NOT EXISTS departments (
    department_id SERIAL PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    manager_id INT
);

-- Employees table
CREATE TABLE IF NOT EXISTS employees (
    employee_id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    department_id INT REFERENCES departments(department_id),
    home_lat DECIMAL(10,8),
    home_lon DECIMAL(11,8),
    hire_date DATE,
    employment_status VARCHAR(50),
    current_role VARCHAR(100),
    work_status VARCHAR(50),
    leave_balance_days INT,
    annual_leave_balance INT
);

-- Update departments to reference employees
ALTER TABLE departments ADD CONSTRAINT fk_manager FOREIGN KEY (manager_id) REFERENCES employees(employee_id);

-- Attendance table
CREATE TABLE IF NOT EXISTS attendance (
    record_id SERIAL PRIMARY KEY,
    employee_id INT REFERENCES employees(employee_id),
    date DATE,
    hours_worked DECIMAL(5,2),
    status VARCHAR(50),
    shift_type VARCHAR(50)
);

-- Leaves table
CREATE TABLE IF NOT EXISTS leaves (
    leave_id SERIAL PRIMARY KEY,
    employee_id INT REFERENCES employees(employee_id),
    start_date DATE,
    end_date DATE,
    leave_type VARCHAR(50),
    status VARCHAR(50)
);

